import React from 'react';
import styles from './ActionSection.module.css';

const ActionSection = () => {
  return (
    <section className={styles.section}>
      <h2 className={styles.title}>Программа действий</h2>
      <ol className={styles.steps}>
        <li>Прибыть на локацию вовремя (лучше за 15 минут).</li>
        <li>Следовать указаниям ведущих.</li>
        <li>Улыбаться, наслаждаться моментом, фотографироваться!</li>
      </ol>
      <div className={styles.mission}>
        <strong>Время любовной операции:</strong> 12:00
      </div>
    </section>
  );
};

export default ActionSection;
